package db.domain;import java.util.Arrays;public class PvpRankRewardImpl implements PvpRankReward {	@Key	private String uname;	private int rank;	private boolean hasReceive;	public PvpRankRewardImpl() {	}	public PvpRankRewardImpl(PvpRankReward c) {		this.uname = c.getUname();		this.rank = c.getRank();		this.hasReceive = c.getHasReceive();	}	@Override	public String tableName() {		return "pvp_rank_reward";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setRank(int rank) {		this.rank = rank;	}	public int getRank() {		return this.rank;	}public void addRank(int rank) {		this.rank += rank;}	public void setHasReceive(boolean hasReceive) {		this.hasReceive = hasReceive;	}	public boolean getHasReceive() {		return this.hasReceive;	}}